import styles from './TextAreaReadOnly.module.css';

function TextAreaReadOnly({ text }) {
    return (
        <div className={styles.container}>
            <div className={styles.inputWrapper}>
                {text.map((msg, index) => (
                    <input 
                        key={index}
                        type="text" 
                        className={styles.inputArea} 
                        readOnly
                        value={msg}
                    />
                ))}
            </div>
        </div>
    );
}

export default TextAreaReadOnly;
